import { keyframes } from 'styled-components';

const spinscale = keyframes`
    0% {
      transform: 
      rotate(0deg) 
      scale(0.9)
    }
    35% {
        transform: 
        rotate(3deg) 
        scale(0.84) 
    }
    70% {
        transform: 
        rotate(7deg) 
        scale(0.9)
    }
    100% {
        transform: 
        rotate(10deg) 
        scale(0.84) 
    }
`
const rotatey = keyframes`
    100% {
      transform: rotate(360deg);
    }
  `
